for(let i=0;i<160;i++) rain.push({x: Math.random()*CANV_W, y: Math.random()*CANV_H, l: 8+Math.random()*28, s: Math.random()*0.8+0.4});

let audioCtx=null, masterGain=null;
function initAudio(){ if(audioCtx) return; audioCtx = new (window.AudioContext || window.webkitAudioContext)(); masterGain = audioCtx.createGain(); masterGain.gain.value = 0.12; masterGain.connect(audioCtx.destination); const o1 = audioCtx.createOscillator(), o2 = audioCtx.createOscillator(); o1.type='sine'; o2.type='sine'; o1.frequency.value=43; o2.frequency.value=44.5; const padG = audioCtx.createGain(); padG.gain.value = 0; o1.connect(padG); o2.connect(padG); padG.connect(masterGain); o1.start(); o2.start(); const lfo = audioCtx.createOscillator(); lfo.frequency.value=0.06; lfo.type='sine'; const lfoG = audioCtx.createGain(); lfoG.gain.value=0.03; lfo.connect(lfoG); lfoG.connect(padG.gain); lfo.start(); padG.gain.linearRampToValueAtTime(0.06, audioCtx.currentTime+1.2); }

let motifTimer=null;
function startMelody(){ initAudio(); const motif = [0,2,4,7,5,4]; let i=0; (function tick(){ if(!audioCtx) return; const t0 = audioCtx.currentTime; const n = motif[i % motif.length]; const freq = 220 * Math.pow(2, (n-12)/12); const o = audioCtx.createOscillator(); o.type='square'; const g = audioCtx.createGain(); g.gain.value = 0.001; o.connect(g); g.connect(masterGain); o.frequency.value = freq; g.gain.setValueAtTime(0.001, t0); g.gain.exponentialRampToValueAtTime(0.07, t0+0.02); g.gain.exponentialRampToValueAtTime(0.0001, t0+0.28); o.start(); o.stop(t0+0.28); i++; motifTimer = setTimeout(tick, 420 + Math.random()*120); })(); }

function drawPixelatedImage(img, scale, dx,dy,dw,dh){
  const off = document.createElement('canvas');
  const s = Math.max(1, Math.floor(Math.min(img.width, img.height) / scale));
  off.width = Math.floor(img.width / s);
  off.height = Math.floor(img.height / s);
  const ox = off.getContext('2d');
  ox.drawImage(img, 0, 0, off.width, off.height);
  ctx.imageSmoothingEnabled = false;
  ctx.globalAlpha = 1.0;
  ctx.drawImage(off, 0, 0, off.width, off.height, dx, dy, dw, dh);
  ctx.imageSmoothingEnabled = true;
}

function spawnFloating(){floating.push({t: verses[(Math.random()*verses.length)|0], x: 80 + Math.random()*(CANV_W-160), y: 180 + Math.random()*220, a:0, life:3800, age:0, vy:-0.018}); if(floating.length>6) floating.shift();}
setInterval(()=>{ if(phase==='intro' || phase==='play') spawnFloating(); }, 4000);
function spawnV(x,y){ vapors.push({x:x + (Math.random()*6-3), y, vy:-0.12, age:0, life:800+Math.random()*700, size:2+Math.random()*3, alpha:1}); if(vapors.length>300) vapors.shift(); }

let introT = 0, introDur = 5200, transT=0, transDur=900;
const startBtn = document.getElementById('startBtn');
const overlayText = document.getElementById('overlayText');
const skipBtn = document.getElementById('skip');
startBtn.addEventListener('click', ()=>{ if(phase==='idle'){ phase='intro'; startBtn.style.display='none'; overlayText.style.display='block'; overlayText.textContent='Penthouse Poet — an ambient alley of neon and rain'; startMelody(); initAudio(); running=true; last = performance.now(); } });
skipBtn.addEventListener('click', ()=>{ if(phase==='intro'){ phase='transition'; transT=transDur; } });

const keys = {}; window.addEventListener('keydown', e=> keys[e.code]=true); window.addEventListener('keyup', e=> keys[e.code]=false);
const player = {x:80,y:CANV_H-120,w:28,h:44,vx:0,vy:0,on:false,dir:1};
const platforms = [{x:0,y:CANV_H-56,w:CANV_W,h:56},{x:120,y:CANV_H-120,w:120,h:12},{x:300,y:CANV_H-200,w:160,h:12},{x:520,y:CANV_H-140,w:120,h:12},{x:660,y:CANV_H-260,w:120,h:12}];

function update(dt){
  if(phase==='intro'){ introT += dt; if(introT > introDur) { phase='transition'; transT=0; } }
  else if(phase==='transition'){ transT += dt; if(transT > transDur){ phase='play'; } }
  else if(phase==='play'){
    player.vx += 0.02 * player.dir;
    player.vx = Math.max(Math.min(player.vx, 1.8), -1.8);
    if((keys['Space']||keys['ArrowUp']||keys['KeyW']) && player.on){ player.vy = -10; player.on=false; }
    player.vy += 0.8 * (dt/16.67);
    player.x += player.vx * (dt/16.67);
    player.y += player.vy * (dt/16.67);
    if(player.x < 6) { player.x = 6; player.dir = 1; player.vx = Math.abs(player.vx); }
    if(player.x + player.w > CANV_W - 6) { player.x = CANV_W - 6 - player.w; player.dir = -1; player.vx = -Math.abs(player.vx); }
    player.on = false;
    for(const p of platforms){
      if(player.x < p.x + p.w && player.x + player.w > p.x && player.y < p.y + p.h && player.y + player.h > p.y){
        if(player.vy > 0 && player.y + player.h - player.vy <= p.y + 2){ player.y = p.y - player.h; player.vy = 0; player.on = true; }
        else { if(player.x < p.x) player.x = p.x - player.w; else player.x = p.x + p.w; player.vx = 0; }
      }
    }
  }
  for(let i=vapors.length-1;i>=0;i--){ const v=vapors[i]; v.age += dt; v.y += v.vy*(dt/16.67); v.x += (Math.random()-0.5)*0.12; v.alpha = 1 - (v.age/v.life); if(v.age>v.life) vapors.splice(i,1); }
  for(let i=floating.length-1;i>=0;i--){ const f=floating[i]; f.age += dt; f.y += f.vy*(dt/16.67); f.a = Math.min(1, f.age/300); if(f.age>f.life) floating.splice(i,1); }
}

function drawPortraitIntro(alpha){
  const iw = introImg.width, ih = introImg.height; if(!iw||!ih) return;
  const scale = 18; const dw = 520, dh = 520; const dx = (CANV_W - dw)/2, dy = 28;
  const off = document.createElement('canvas'); off.width = Math.max(4, Math.floor(iw/scale)); off.height = Math.max(4, Math.floor(ih/scale));
  const ox = off.getContext('2d'); ox.drawImage(introImg, 0, 0, off.width, off.height);
  ctx.imageSmoothingEnabled = false; ctx.globalAlpha = alpha; ctx.drawImage(off, 0, 0, off.width, off.height, dx, dy, dw, dh); ctx.imageSmoothingEnabled = true; ctx.globalAlpha = 1.0;
  ctx.fillStyle = 'rgba(0,0,0,0.18)'; ctx.fillRect(0,0,CANV_W,dy+10); ctx.fillRect(0,dy+dh-10,CANV_W,40);
}

function drawRain(){ ctx.globalAlpha = 0.06; ctx.fillStyle = '#8f6bf0'; const t=performance.now(); for(let i=0;i<rain.length;i++){ const r=rain[i]; const ry = (r.y + (t*0.03*r.s))%CANV_H; ctx.fillRect(r.x, ry, 1, r.l*0.6); } ctx.globalAlpha = 1; }

function drawPlayScene(){
  const g = ctx.createLinearGradient(0,0,CANV_W,CANV_H); g.addColorStop(0,'#020014'); g.addColorStop(1,'#030014'); ctx.fillStyle = g; ctx.fillRect(0,0,CANV_W,CANV_H);
  const t = performance.now(); for(let layer=0;layer<3;layer++){ const speed = 0.009*(layer+1); const alpha = 0.06 + layer*0.03; ctx.globalAlpha = alpha; for(let b=-2;b<9;b++){ const bx = (b*(160-layer*10) + (t*speed*(layer+1)))%(CANV_W+200)-100; const by = 24 + layer*36; ctx.fillStyle = `rgba(120,80,200,${0.045 + layer*0.02})`; ctx.fillRect(bx,by,120 - layer*10,28 + layer*8); ctx.fillStyle = `rgba(159,124,255,${0.02 + layer*0.01})`; ctx.fillRect(bx+12,by+6,28,6); } } ctx.globalAlpha = 1;
  drawRain(); ctx.fillStyle = '#0f0b16'; for(const p of platforms){ ctx.fillRect(p.x,p.y,p.w,p.h); ctx.fillStyle = '#7c3aed'; ctx.fillRect(p.x,p.y+p.h-4,p.w,4); ctx.fillStyle = '#0f0b16'; }
  for(const v of vapors){ ctx.globalAlpha = Math.max(0,v.alpha); ctx.fillStyle = 'rgba(200,160,255,0.9)'; ctx.fillRect(Math.round(v.x), Math.round(v.y), v.size, v.size); } ctx.globalAlpha = 1;
  const px = Math.round(player.x), py = Math.round(player.y); ctx.fillStyle = '#020203'; ctx.fillRect(px, py - player.h, player.w, player.h);
  ctx.fillStyle = 'rgba(159,124,255,0.95)'; ctx.fillRect(px + Math.round(player.w*0.6), py - player.h + 8, 3, 3);
  if(Math.random() < 0.1) spawnV(px + Math.round(player.w*0.6)+1, py - player.h + 6);
  ctx.textAlign = 'center'; ctx.fillStyle = 'rgba(240,230,255,0.9)'; ctx.font = '14px monospace'; for(const f of floating){ ctx.globalAlpha = Math.max(0,f.a); ctx.fillText(f.t, f.x, f.y); } ctx.globalAlpha = 1; ctx.textAlign = 'start';
  ctx.fillStyle = 'rgba(220,210,255,0.95)'; ctx.font = '12px monospace'; ctx.fillText('Penthouse Poet — Ambient', 12, 20);
}

function draw(){ ctx.clearRect(0,0,CANV_W,CANV_H); if(phase==='idle'){ const g = ctx.createLinearGradient(0,0,CANV_W,CANV_H); g.addColorStop(0,'#020014'); g.addColorStop(1,'#030014'); ctx.fillStyle = g; ctx.fillRect(0,0,CANV_W,CANV_H); drawRain(); ctx.fillStyle = 'rgba(240,230,255,0.06)'; ctx.fillRect(CANV_W/2-220, CANV_H/2-40, 440, 80); ctx.fillStyle = '#efe7ff'; ctx.font='22px monospace'; ctx.textAlign='center'; ctx.fillText('Penthouse Poet', CANV_W/2, CANV_H/2+6); ctx.textAlign='start'; } else if(phase==='intro'){ const g = ctx.createLinearGradient(0,0,CANV_W,CANV_H); g.addColorStop(0,'#020014'); g.addColorStop(1,'#030014'); ctx.fillStyle = g; ctx.fillRect(0,0,CANV_W,CANV_H); drawRain(); const a = Math.min(1, introT / 900); drawPortraitIntro(a); ctx.textAlign = 'center'; ctx.fillStyle = 'rgba(240,230,255,0.95)'; ctx.font='16px monospace'; let y = CANV_H - 80; for(let i=0;i<floating.length;i++){ const f=floating[i]; ctx.globalAlpha = Math.min(1, f.age/300); ctx.fillText(f.t, CANV_W/2, y - i*20); } ctx.globalAlpha = 1; ctx.textAlign='start'; } else if(phase==='transition'){ const t = Math.min(1, transT / transDur); drawPortraitIntro(Math.max(0, 1 - t)); drawPlayScene(); ctx.fillStyle = 'rgba(0,0,0,' + (0.2 * t) + ')'; ctx.fillRect(0,0,CANV_W,CANV_H); } else if(phase==='play'){ drawPlayScene(); } }

let then = performance.now();
function loop(now){ const dt = Math.min(40, now - then); then = now; update(dt); draw(); requestAnimationFrame(loop); }
requestAnimationFrame(loop);

})();
</script>
</body>
</html>
